pragma solidity ^0.5;

import "../../ProjectContract/contracts/ProjectContract.sol";


contract ProjectHubContract{

    Project[] projects;
    mapping(address => Project[]) projectsForAddress;


    struct Project{
        address owner;
        address projectAdress;
        string projectName;
        string projectDescription;
    }


    function addNewProject(string memory projectName, string memory projectDescription) public returns (bool)
    {
        ProjectContract projectContract = new ProjectContract(msg.sender, projectName, projectDescription, this);
        Project memory project = Project(msg.sender, address(projectContract), projectName, projectDescription);
        projects.push(project);
        projectsForAddress[msg.sender].push(project);
    }

    function getProjectCount() public view returns (uint)
    {
        return projects.length;
    }

    function getProject(uint projectIndex) public view returns (address, address, string memory, string memory)
    {
        require(projectIndex < projects.length, "Index is out of bounds");

        return (projects[projectIndex].owner,
                projects[projectIndex].projectAdress,
                projects[projectIndex].projectName,
                projects[projectIndex].projectDescription);
    }

    function getProjectCountForAddress() public view returns (uint)
    {
        return projectsForAddress[msg.sender].length;
    }

    function getProjectsForAddressAndIndex(uint projectIndex) public view returns (address, address, string memory, string memory)
    {
        require(projectIndex < projectsForAddress[msg.sender].length, "Index is out of bounds");

        return (projectsForAddress[msg.sender][projectIndex].owner,
                projectsForAddress[msg.sender][projectIndex].projectAdress,
                projectsForAddress[msg.sender][projectIndex].projectName,
                projectsForAddress[msg.sender][projectIndex].projectDescription);
    }
}
